    "body": "Bumps [handlebars](https://github.com/wycats/handlebars.js) from 4.4.5 to 4.7.6.\n<details>\n<summary>Changelog</summary>\n<p><em>Sourced from <a href=\"https://github.com/handlebars-lang/handlebars.js/blob/master/release-notes.md\">handlebars's changelog</a>.</em></p>\n<blockquote>\n<h2>v4.7.6 - April 3rd, 2020</h2>\n<p>Chore/Housekeeping:</p>\n<ul>\n<li><a href=\"https://github-redirect.dependabot.com/wycats/handlebars.js/issues/1672\">#1672</a> - Switch cmd parser to latest minimist (<a href=\"https://api.github.com/users/dougwilson\">@dougwilson</a></li>\n</ul>\n<p>Compatibility notes:</p>\n<ul>\n<li>Restored Node.js compatibility</li>\n</ul>\n<p><a href=\"https://github.com/wycats/handlebars.js/compare/v4.7.5...v4.7.6\">Commits</a></p>\n<h2>v4.7.5 - April 2nd, 2020</h2>\n<p>Chore/Housekeeping:</p>\n<ul>\n<li><del>Node.js version support has been changed to v6+</del> Reverted in 4.7.6</li>\n</ul>\n<p>Compatibility notes:</p>\n<ul>\n<li><del>Node.js &lt; v6 is no longer supported</del> Reverted in 4.7.6</li>\n</ul>\n<p><a href=\"https://github.com/wycats/handlebars.js/compare/v4.7.4...v4.7.5\">Commits</a></p>\n<h2>v4.7.4 - April 1st, 2020</h2>\n<p>Chore/Housekeeping:</p>\n<ul>\n<li><a href=\"https://github-redirect.dependabot.com/wycats/handlebars.js/issues/1666\">#1666</a> - Replaced minimist with yargs for handlebars CLI (<a href=\"https://api.github.com/users/aorinevo\">@aorinevo</a>, <a href=\"https://api.github.com/users/AviVahl\">@AviVahl</a> &amp; <a href=\"https://api.github.com/users/fabb\">@fabb</a>)</li>\n</ul>\n<p>Compatibility notes:</p>\n<ul>\n<li>No incompatibilities are to be expected</li>\n</ul>\n<p><a href=\"https://github.com/wycats/handlebars.js/compare/v4.7.3...v4.7.4\">Commits</a></p>\n<h2>v4.7.3 - February 5th, 2020</h2>\n<p>Chore/Housekeeping:</p>\n<ul>\n<li><a href=\"https://github-redirect.dependabot.com/wycats/handlebars.js/issues/1644\">#1644</a> - Download links to aws broken on handlebarsjs.com - access denied (<a href=\"https://api.github.com/users/Tea56\">@Tea56</a>)</li>\n<li>Fix spelling and punctuation in changelog - d78cc73</li>\n</ul>\n<p>Bugfixes:</p>\n<ul>\n<li>Add Type Definition for Handlebars.VERSION, Fixes <a href=\"https://github-redirect.dependabot.com/wycats/handlebars.js/issues/1647\">#1647</a> - 4de51fe</li>\n<li>Include Type Definition for runtime.js in Package - a32d05f</li>\n</ul>\n<p>Compatibility notes:</p>\n<!-- raw HTML omitted -->\n</blockquote>\n</details>\n<details>\n<summary>Commits</summary>\n<ul>\n<li><a href=\"https://github.com/handlebars-lang/handlebars.js/commit/e6ad93ea01bcde1f8ddaa4b4ebe572dd616abfaa\"><code>e6ad93e</code></a> v4.7.6</li>\n<li><a href=\"https://github.com/handlebars-lang/handlebars.js/commit/2bf4fc6fd3ae3d8f076d628653f284d85faebeb4\"><code>2bf4fc6</code></a> Update release notes</li>\n<li><a href=\"https://github.com/handlebars-lang/handlebars.js/commit/b64202bc9197307bd785a58693e3820eb9bb41a8\"><code>b64202b</code></a> Update release-notes.md</li>\n<li><a href=\"https://github.com/handlebars-lang/handlebars.js/commit/c2f1e6203178918569f085e12afdb762cae17fb0\"><code>c2f1e62</code></a> Switch cmd parser to latest minimist</li>\n<li><a href=\"https://github.com/handlebars-lang/handlebars.js/commit/08e9a11a34c3ad8387a0b85b1334f97cab85191a\"><code>08e9a11</code></a> Revert &quot;chore: set Node.js compatibility to v6+&quot;</li>\n<li><a href=\"https://github.com/handlebars-lang/handlebars.js/commit/1fd2edee2a12fb228061fcde807905c6b14339c4\"><code>1fd2ede</code></a> v4.7.5</li>\n<li><a href=\"https://github.com/handlebars-lang/handlebars.js/commit/3c9c2f5cf29cf10f54d5fe4daca6b24b65f0adcf\"><code>3c9c2f5</code></a> Update release notes</li>\n<li><a href=\"https://github.com/handlebars-lang/handlebars.js/commit/16487a088e13f4d52c6fd6610b9ec71c4a51be8a\"><code>16487a0</code></a> chore: downgrade yargs to v14</li>\n<li><a href=\"https://github.com/handlebars-lang/handlebars.js/commit/309d2b49a11628d2a8f052c5587e7459968cd705\"><code>309d2b4</code></a> chore: set Node.js compatibility to v6+</li>\n<li><a href=\"https://github.com/handlebars-lang/handlebars.js/commit/645ac73844918668f9a2f41e49b7cb18ce5abf36\"><code>645ac73</code></a> test: fix integration tests</li>\n<li>Additional commits viewable in <a href=\"https://github.com/wycats/handlebars.js/compare/v4.4.5...v4.7.6\">compare view</a></li>\n</ul>\n</details>\n<details>\n<summary>Maintainer changes</summary>\n<p>This version was pushed to npm by <a href=\"https://www.npmjs.com/~erisds\">erisds</a>, a new releaser for handlebars since your current version.</p>\n</details>\n<br />\n\n\n[![Dependabot compatibility score](https://dependabot-badges.githubapp.com/badges/compatibility_score?dependency-name=handlebars&package-manager=npm_and_yarn&previous-version=4.4.5&new-version=4.7.6)](https://docs.github.com/en/github/managing-security-vulnerabilities/configuring-github-dependabot-security-updates)\n\nDependabot will resolve any conflicts with this PR as long as you don't alter it yourself. You can also trigger a rebase manually by commenting `@dependabot rebase`.\n\n[//]: # (dependabot-automerge-start)\n[//]: # (dependabot-automerge-end)\n\n---\n\n<details>\n<summary>Dependabot commands and options</summary>\n<br />\n\nYou can trigger Dependabot actions by commenting on this PR:\n- `@dependabot rebase` will rebase this PR\n- `@dependabot recreate` will recreate this PR, overwriting any edits that have been made to it\n- `@dependabot merge` will merge this PR after your CI passes on it\n- `@dependabot squash and merge` will squash and merge this PR after your CI passes on it\n- `@dependabot cancel merge` will cancel a previously requested merge and block automerging\n- `@dependabot reopen` will reopen this PR if it is closed\n- `@dependabot close` will close this PR and stop Dependabot recreating it. You can achieve the same result by closing it manually\n- `@dependabot ignore this major version` will close this PR and stop Dependabot creating any more for this major version (unless you reopen the PR or upgrade to it yourself)\n- `@dependabot ignore this minor version` will close this PR and stop Dependabot creating any more for this minor version (unless you reopen the PR or upgrade to it yourself)\n- `@dependabot ignore this dependency` will close this PR and stop Dependabot creating any more for this dependency (unless you reopen the PR or upgrade to it yourself)\n- `@dependabot use these labels` will set the current labels as the default for future PRs for this repo and language\n- `@dependabot use these reviewers` will set the current reviewers as the default for future PRs for this repo and language\n- `@dependabot use these assignees` will set the current assignees as the default for future PRs for this repo and language\n- `@dependabot use this milestone` will set the current milestone as the default for future PRs for this repo and language\n\nYou can disable automated security fix PRs for this repo from the [Security Alerts page](https://github.com/ember-codemods/power-select-deprecation-codemod/network/alerts).\n\n</details>",
